import Expenses from './Expenses';
import ExspenseDate from './ExpenseDate';
import './ExpenseItem.css';

function ExpenseItem(props) {
  

  return (
    <div className='expense-item'>
      <ExspenseDate date={props.date}/>
      <Expenses/>
    </div>
  );
}
export default ExpenseItem;
